(7, 1, '2023-01-05 08:29:17', '2023-01-05 08:29:17', '<h2 class=\"h\">My name is Alex Novo, Im a photographer.</h2>\r\nThe world without photography will be meaningless to us if there is no light and color, which opens up our minds and expresses passion.\r\n\r\nMy style is a combination between photojournalism and fine-art photography with a touch of fashion and creative lighting. My photos are inspired by light, color, techniques from black &amp; white processing, vintage photos, creative perspective, and of course, most importantly, the personalities of the people I photograph!\r\n<h3>Collaboration.</h3>\r\nI wanted to capture everything that seemed magical to the eye. After 5 years of thisa andoi freelancing and working for big companies I founded my own photography agency. I meani back and forth from Ohio to Nevada for work.', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2023-01-06 07:16:06', '2023-01-06 07:16:06', '', 0, 'http://localhost/wedding_heart/?page_id=7', 0, 'page', '', 0),
