(132, 1, '2023-01-06 07:16:06', '2023-01-06 07:16:06', '<h2 class=\"h\">My name is Alex Novo, Im a photographer.</h2>\r\nThe world without photography will be meaningless to us if there is no light and color, which opens up our minds and expresses passion.\r\n\r\nMy style is a combination between photojournalism and fine-art photography with a touch of fashion and creative lighting. My photos are inspired by light, color, techniques from black &amp; white processing, vintage photos, creative perspective, and of course, most importantly, the personalities of the people I photograph!\r\n<h3>Collaboration.</h3>\r\nI wanted to capture everything that seemed magical to the eye. After 5 years of thisa andoi freelancing and working for big companies I founded my own photography agency. I meani back and forth from Ohio to Nevada for work.', 'About', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2023-01-06 07:16:06', '2023-01-06 07:16:06', '', 7, 'http://localhost/wedding_heart/?p=132', 0, 'revision', '', 0);
